import Logo from '../assets/images/logo_Kasa_acceuil.png';
import Navigation from './composants/Navigation';

export default function Header() {
    return (<>
        <header className='header'>
            <img src={Logo} alt='logo kasa'/>
            <Navigation/>
        </header>
        </>
    )
   
};
